<template>
	<view class="p-profile" :style="{height:wrapperHeight+'px'}" @touchmove.prevent>
		<div class="user-info">
			<image :src="userData.avatar"></image>
			<text>{{userData.userName}}</text>
		</div>
		<view class="profile-list">
			<text class="t-col link-item" @click="jumpTo('update')"><text class="ico-label modify"></text>修改资料</text>
			<text class="t-col link-item" @click="jumpTo('setting')"><text class="ico-label setting"></text>系统设置</text>
			<text class="t-col link-item" @click="jumpTo('feedback')"><text class="ico-label feedback"></text>反馈与建议</text>
			<text class="t-col link-item" @click="jumpTo('about')"><text class="ico-label about"></text>关于应用</text>
			<!-- #ifdef H5 -->
			<text class="t-col logout" @click="logout"><text class="ico-label exit"></text>退出登录</text>
			<!-- #endif -->
		</view>
		<!-- <div style="width:300px;margin:0 auto; padding:20px 0;">
			<a target="_blank" href="http://www.beian.gov.cn/portal/registerSystemInfo?recordcode=42011102003899" style="display:inline-block;text-decoration:none;height:20px;line-height:20px;"><img
				 src="" style="float:left;" />
				<p style="float:left;height:20px;line-height:20px;margin: 0px 0px 0px 5px; color:#939393;">鄂公网安备 42011102003899号</p>
			</a>
		</div> -->
	</view>
</template>

<script>
	export default {
		name: 'profile',
		data() {
			return {
				loading: false,
				wrapperHeight: uni.getSystemInfoSync().windowHeight, //内容高度
				userData: {
					userName: '',
					avatar: ''
				}
			}
		},
		onShow() {
			this.$checkLogin()
			this.getUserInfo()
		},
		methods: {
			getUserInfo() {
				this.$request({
					path: '/todo/getUserInfo',
				}).then(res => {
					this.userData = { ...this.userData,
						...res.data
					}
					uni.setStorage({
						key: 'user-info',
						data: res.data
					});
				})
			},
			jumpTo(pageName) {
				if (pageName === 'update') {
					uni.navigateTo({
						url: `/pages/${pageName}?name=${encodeURIComponent(this.userData.userName)}`
					})
				} else {
					uni.navigateTo({
						url: `/pages/${pageName}`
					})
				}
			},
			// 退出
			logout() {
				if (this.loading) return false;
				this.loading = true
				this.$loading.show('处理中…')
				this.$request({
					path: '/todo/logout',
					method: 'POST',
				}).then(res => {
					this.loading = false
					this.$loading.hide()
					uni.removeStorageSync('user-info')
					uni.removeStorage({
						key: 'user-token',
						success: function() {
							uni.reLaunch({
								url: '/pages/login'
							})
						}
					})
				}).catch(err => {
					this.loading = false
					this.$loading.hide()
				})
			}
		},
	}
</script>

<style lang="scss">
	.p-profile {
		overflow: auto;
		background: #f5f5f5;

		.user-info {
			box-sizing: border-box;
			padding: 30px;
			margin-bottom: 30rpx;
			background: url(data:image/jpg;base64,) no-repeat center;
			-webkit-background-size: 100% 100%;
			background-size: 100% 100%;

			image {
				display: block;
				margin: 0 auto 10rpx;
				width: 180rpx;
				height: 180rpx;
				background: #f5f5f5;
				border-radius: 50%;
			}

			text {
				display: block;
				text-align: center;
				font-size: 30rpx;
				color: #fff;
			}
		}

		.profile-list {
			margin-bottom: 30rpx;

			.t-col {
				position: relative;
				box-sizing: border-box;
				display: block;
				height: 90rpx;
				line-height: 90rpx;
				padding: 0 40rpx;
				text-align: left;
				font-size: 28rpx;
				color: #333;
				background: #fff;
				border-bottom: 1px solid #eee;

				.ico-label {
					position: relative;
					margin-right: 10px;
					display: inline-block;
					width: 42rpx;
					height: 42rpx;

					&.modify {
						top: 4px;
						background: url(../static/img/ico_edit.png) no-repeat center;
						-webkit-background-size: cover;
						background-size: cover;
					}

					&.setting {
						left: -1px;
						top: 4px;
						background: url(../static/img/ico_setting.png) no-repeat center;
						-webkit-background-size: 40rpx auto;
						background-size: 40rpx auto;
					}

					&.feedback {
						top: 3px;
						width: 38rpx;
						height: 38rpx;
						background: url(../static/img/ico_feedback.png) no-repeat center;
						-webkit-background-size: cover;
						background-size: cover;
					}

					&.about {
						top: 4px;
						width: 38rpx;
						height: 38rpx;
						background: url(../static/img/ico_about.png) no-repeat center;
						-webkit-background-size: cover;
						background-size: cover;
					}

					&.exit {
						top: 3px;
						width: 38rpx;
						height: 38rpx;
						background: url(../static/img/ico_logout.png) no-repeat center;
						-webkit-background-size: cover;
						background-size: cover;
					}
				}

				&.link-item:before {
					position: absolute;
					content: '';
					right: 10rpx;
					top: 19rpx;
					width: 48rpx;
					height: 48rpx;
					background: url(../static/img/ico_arrow_right.png) no-repeat center;
					-webkit-background-size: cover;
					background-size: cover;
				}

				&.logout {
					margin-top: 20rpx;
					border: none;
				}
			}
		}
	}
</style>
